    Post-Sandy Topobathymetric LiDAR: Void DEMs South Carolina to New York",nt"tracking_summary":
    {ntt"total": 8,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-12-20T19:03:03.621741",nt"name": "2014-noaa-post-sandy-topobathymetric-lidar-void-dems-south-carolina-to-new-york",nt"isopen":
    false,nt"url": null,nt"notes": "These data were collected by the National
    Oceanic Atmospheric Administration National Geodetic Survey Remote Sensing Division
    using a Riegl VQ820G system. The data were acquired from 201311- 201406. The data
    includes topobathy data with points classified by target type (e.g. ground, water,
    etc). The final classified LiDAR data were then used to create topobathymetric DEMs
    in IMG format with 1m pixel size using ground points. The full project consists
    of 2,775 square miles along the Atlantic Coast from New York to South Carolina,
    or 41,388 - 500 m x 500 m lidar tiles. These tiles have been combined into 140 larger
    blocks. The data collection and processing was funded by post-Sandy supplemental
    funds. While Sandy was considered an extra-tropical storm when it struck, the word
    hurricane is in this sentence for search purposes.",nt"license_title": null,nt"extras":
